import React from "react";
import Markdown from "markdown-to-jsx";
import { Box, BoxItem, Button, Card, CardContent, Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';
import { ArrowBack } from '@material-ui/icons';
import profilbild from "./images/profilbild_test.jpg"

const Hem = () => {

    const useStyles = makeStyles({
        container: {
            padding: "0",
            margin: "0"
        },
        buttonCard : {
          marginLeft: "10px",
          marginTop: "10px",
          size: "small",
          borderRadius: "20px",
          backgroundColor: "rgb(51,51,51, 0.2)"
          
        },
        sectionCard : {
          marginBottom: "0",
          minHeight: "50vh"
          
        },
        sectionMain : {
          marginBottom: "0",
          minHeight: "50vh"
          },
          mainDiv: {
            margin: "30px"
          },
          imgProfile: {
            margin: "30px",
            height: "200px"
          }
      })

      const classes = useStyles();
    return (
    <div className={classes.mainDiv}>
  
                        <Typography variant="h4">
                          Välkommen!
                        </Typography>
                        <Box >
                        <BoxItem className ={classes.imgProfile}
                        component="img"
                        alt="Picture did not load"
                        src={profilbild}
                        />

                        <BoxItem 
                        component="img"
                        alt="Picture did not load"
                        src={profilbild}
                        />
                        </Box>
                        <Typography variant="h6">
                          Detta är min personliga hemsida
                        </Typography>
    </div>
    )
    
}

export {Hem}
